import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import WelcomePage from './components/WelcomePage';
import InstructionsPage from './components/InstructionsPage';
import ImageProcessingPage from './components/ImageProcessingPage';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <div className='container'>
            <button>
              <a href="/">Trang chủ</a>
            </button>
            <button>
              <a href="/instructions">Hướng dẫn sử dụng</a>
            </button>
            <button>
              <a href="/image-processing">Bắt đầu</a>
            </button>
          </div>
        </nav>
        <h1>Chào mừng đến với ứng dụng giảm nhiễu ảnh</h1>
        <Routes>
          <Route path="/" element={<WelcomePage />} />
          <Route path="/instructions" element={<InstructionsPage />} />
          <Route path="/image-processing" element={<ImageProcessingPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
